import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { getQueue, getAppointments } from '../services/api';
import './Dashboard.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import './assets/css/style.css';

const statusColors = {
  'รับเข้า': 'badge bg-danger', // แดงพาสเทล
  'อยู่ระหว่างทำความสะอาด': 'badge bg-warning', // ส้มพาสเทล
  'เตรียมส่ง': 'badge bg-info', // เหลืองพาสเทล
  'กำลังจัดส่ง': 'badge bg-primary', // ชมพูพาสเทล
  'สำเร็จ': 'badge bg-success', // เขียวพาสเทล
};

const appointmentColors = {
  'รอดำเนินการ': 'badge bg-danger', // แดงพาสเทล
  'ยืนยันแล้ว': 'badge bg-warning', // เหลืองพาสเทล
  'สำเร็จ': 'badge bg-success', // เขียวพาสเทล
};

const Dashboard = () => {
  const navigate = useNavigate();
  const [queue, setQueue] = useState([]);
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
    }
    fetchQueueData();
    fetchAppointmentData();
  }, []);

  const fetchQueueData = async () => {
    try {
      const res = await getQueue();
      setQueue(res.data);
    } catch (error) {
      console.error('🔴 Error fetching queue data:', error);
    }
  };

  const fetchAppointmentData = async () => {
    try {
      const res = await getAppointments();
      setAppointments(res.data);
    } catch (error) {
      console.error('🔴 Error fetching appointments:', error);
    }
  };

  return (
    <div className="container-fluid mt-4">
      <div className="row">
        <div className="col-lg-12">
          <h1 className="text-center mb-4">📊 Dashboard</h1>
          <div className="card">
            <div className="card-body">
              <h2>🔄 คิวงานที่รอดำเนินการ ({queue.length} รายการ)</h2>
              <table className="table table-hover table-bordered">
                <thead className="table-dark">
                  <tr>
                    <th>ลูกค้า</th>
                    <th>สถานที่</th>
                    <th>จำนวนคู่</th>
                    <th>วันที่ส่งคืน</th>
                    <th>สถานะ</th>
                  </tr>
                </thead>
                <tbody>
                  {queue.map(item => (
                    <tr key={item.queue_id}>
                      <td>{item.customer_name}</td>
                      <td>{item.location}</td>
                      <td>{item.total_pairs}</td>
                      <td>{new Date(item.delivery_date).toLocaleDateString()}</td>
                      <td><span className={statusColors[item.status]}>{item.status}</span></td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
      
      <div className="row mt-4">
        <div className="col-lg-12">
          <div className="card">
            <div className="card-body">
              <h2>📅 นัดหมายที่รอดำเนินการ ({appointments.length} รายการ)</h2>
              <table className="table table-hover table-bordered">
                <thead className="table-dark">
                  <tr>
                    <th>ลูกค้า</th>
                    <th>เบอร์โทร</th>
                    <th>วันนัดหมาย</th>
                    <th>สถานะ</th>
                  </tr>
                </thead>
                <tbody>
                  {appointments.map(appt => (
                    <tr key={appt.id}>
                      <td>{appt.customer_name}</td>
                      <td>{appt.phone}</td>
                      <td>{new Date(appt.appointment_date).toLocaleDateString()}</td>
                      <td><span className={appointmentColors[appt.status]}>{appt.status}</span></td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
